import React, { Component } from "react";

class useritem extends Component {
  state = {
    id: "id",
    login: "theOnlyihao",
    avatar_url:
      "https://gravatar.com/avatar/2a0bc7fd7fa6c3f5b5fc705783d21426?s=400&d=robohash&r=x",
    html_url: "https://github.com/theOnlyihao",
  };

  render() {
    const { login, avatar_url, html_url } = this.state;

    return (
      <div className="card text-center">
        <img
          src={avatar_url}
          alt=""
          className="round-img"
          style={{
            width: "60px",
          }}
        />
        <h3>{login}</h3>

        <div>
          <a href={html_url} className="btn btn-dark btn-sm my-1">
            More
          </a>
        </div>
      </div>
    );
  }
}

export default useritem;
